  /* Referral Tracking and storing comes here */

    // get all utm related tags here //
    var utm_source = getParameterByName('utm_source');
    if(utm_source == undefined || utm_source == null || utm_source == ''){
      utm_source = getParameterByName('gclid');
      if(utm_source != undefined && utm_source != null && utm_source != ''){
          utm_source = 'google ad';
      }
    }
    //if utm_source is present there
    if(utm_source != undefined && utm_source != null){
      //get already utm cookie
      var vrReferral = getCookie('__referral');
      //if we have already referral data
      if(vrReferral != null && vrReferral != undefined && vrReferral != ''){
        vrReferral = JSON.parse(vrReferral);
        if(vrReferral.source != utm_source){
          //if the referral is new or other , delete previously
            eraseCookie('__referral');
            var vrRef = {
              'source' : utm_source,
              'medium' : getParameterByName('utm_medium'),
              'campaign' : getParameterByName('utm_campaign'),
              'term' : getParameterByName('utm_term'),
              'content' : getParameterByName('utm_content')
            }
          //set referral cookie for next 20 minutes
          setCookie('__referral', JSON.stringify(vrRef), 0.41);
        }
      }else{
        var vrRef = {
          'source' : utm_source,
          'medium' : getParameterByName('utm_medium'),
          'campaign' : getParameterByName('utm_campaign'),
          'term' : getParameterByName('utm_term'),
          'content' : getParameterByName('utm_content')
        }
      //set referral cookie for next 20 minutes
      setCookie('__referral', JSON.stringify(vrRef), 0.0138);
      }
    }
  /*======= Referral System ends here =======*/


  //colored console to aware users not to deal with console.
