//function to load more data based on scroll or show more buttons
  function loadMore(url,page,appendTo,queryParam){
    if(queryParam != undefined && queryParam != null){
      url = url + '?page=' + page + '&q=' + queryParam;
    }else{
      url = url + '?page=' + page;
    }
    var x=true;
    $.ajax({
        type: "get",
        url: url,
        success: function(response) {
          //get the respose here appeend to page
          if(response){
              $('#type_options').append(response);
              $('#loading').addClass('hides');
              $('span.stars').stars();
              //lazy laod all the images here
              $("img.lazyload").lazyload({
                           event: "lazyload",
                           effect: "fadeIn",
                           effectspeed: 1000,
                           threshold : 400
                         })
                       .trigger("lazyload");
              $("#loadmore").remove();

          }else{
            $('.showmore').css('display','none');
            $('#loading').addClass('hides');
          }
        },
        error: function (textStatus, errorThrown) {
          $('.showmore').attr('display','none');
          $('#loadmore').addClass('hides');
        },
        always : function (textStatus, errorThrown){
          $('#loadmore').addClass('hides');
        }
    });
  }

//function get the query string from url by name
function getParameterByName(name, url) {
    if (!url) url = window.location.href;
    name = name.replace(/[\[\]]/g, "\\$&");
    var regex = new RegExp("[?&]" + name + "(=([^&#]*)|&|#|$)"),
        results = regex.exec(url);
    if (!results) return null;
    if (!results[2]) return '';
    return decodeURIComponent(results[2].replace(/\+/g, " "));
}


//function to increase and decrease the adult and child count
$(document).on('click', '.increaseAdult',function(){
  var adultCount = parseInt($(".adultCountText").text());
  if(adultCount < 4){
   adultCount++;
   $(".adultCountText").text(adultCount);
   $(".adultCount").text(adultCount);
  }
});
$(document).on('click', '.decreaseAdult',function(){
  var adultCount = parseInt($(".adultCountText").text());
  if(adultCount > 1){
   adultCount--;
   $(".adultCountText").text(adultCount);
   $(".adultCount").text(adultCount);
  }
});
$(document).on('click', '.increaseChild',function(){
  var childCount = parseInt($(".childCountText").text());
  if(childCount < 3){
   childCount++;
   $(".childCountText").text(childCount);
   $(".childrenCount").text(childCount);
  }
});

$(document).on('click', '.decreaseChild',function(){
  var childCount = parseInt($(".childCountText").text());
  if(childCount > 0){
   childCount--;
   $(".childCountText").text(childCount);
   $(".childrenCount").text(childCount);
  }
});
