$(document).on("submit", "#planholiday", function(event){
  event.preventDefault();
  var name = $(this).find('.plan_name').val();
  if(name == ''){
    $('.plan_name').addClass('err-border');
    event.preventDefault();
    return false;
  }else {
    $('.plan_name').removeClass('err-border');
  }
  var email = $(this).find('.plan_email').val();
  if(email == '' || !(validateEmail(email))){
    $('.plan_email').addClass('err-border');
    event.preventDefault();
    return false;
  }else {
    $('.plan_email').removeClass('err-border');
  }
  var phone = $(this).find('.plan_number').val();
  if(phone == '' || phone.length < 10){
    $('.plan_number').addClass('err-border');
    event.preventDefault();
    return false;
  }else {
    $('.plan_number').removeClass('err-border');
  }
  var page_url = $('#page_url').val();
  var currentUrl = window.location.href ;
  var payload = {
    'name' : name,
    'email' : email,
    'phone' : phone,
    'source': getGAPageNumber(1),
    'page_url' : page_url
  };
  //console.log(payload);
  //$(".overlay").show();
  $.ajax({
      type: "POST",
      url: vrGlobal.base_url+"welcome/plan_holiday",
      cache: false,
      data: {"payload": payload}
  }).done(function (response) {
      response = JSON.parse(response);
      if(response.status == 1 || response.status == true){
        ga('send', 'event', getGAPageNumber(1) , 'Click', 'Enquiry');
      }
      $('#planholiday')[0].reset();
      $(".overlay").hide();
      $("#snackbarplan").text('Your query has been submitted succesfully, we shall call you shortly.');
       var x = document.getElementById("snackbarplan");
      x.className = "show";
      setTimeout(function(){ x.className = x.className.replace("show"); }, 5000);
      setIdentifieCookie(name,email,phone)
      if (page_url != '') {
        setTimeout(function(){window.location.href = page_url; }, 2000);
      }
  }).always(function(response){
    var x = document.getElementById("snackbarplan");
    x.className = "show";
    $("#snackbarplan").addClass('success');
    setTimeout(function(){ x.className = x.className.replace("show", ""); }, 5000);
    $(".overlay").hide();
  });
});

