function validateEmail(sEmail) {
  var reEmail = /^(?:[\w\!\#\$\%\&\'\*\+\-\/\=\?\^\`\{\|\}\~]+\.)*[\w\!\#\$\%\&\'\*\+\-\/\=\?\^\`\{\|\}\~]+@(?:(?:(?:[a-zA-Z0-9](?:[a-zA-Z0-9\-](?!\.)){0,61}[a-zA-Z0-9]?\.)+[a-zA-Z0-9](?:[a-zA-Z0-9\-](?!$)){0,61}[a-zA-Z0-9]?)|(?:\[(?:(?:[01]?\d{1,2}|2[0-4]\d|25[0-5])\.){3}(?:[01]?\d{1,2}|2[0-4]\d|25[0-5])\]))$/;
  if(sEmail != undefined && sEmail != ''){
      if(!sEmail.match(reEmail)) {
    return false;
  }
  return true;
}else{
  return false;
}

}


//get url parameter by indexing
function getGAPageNumber(index){
  var param = location.pathname.split('/')[index];
  if(param == undefined || param == null || param == ''){
    return 'Home';
  }else{
    return param.charAt(0).toUpperCase() + param.slice(1);
  }
}
//Date prototype to add number in days
Date.prototype.addDays = function(days) {
    //console.log(">>>>>>>>>> ",  new Date(new Date().getTime() + days*24*60*60*1000));
     //return new Date(new Date().getTime() + days*24*60*60*1000);
     var thisDate = new Date(this.valueOf());
     thisDate.setDate(thisDate.getDate() + days);
     return thisDate;
};

//format date in strinf  YYYY-MM-DD format
Date.prototype.convertDate = function() {
  var mm = this.getMonth() + 1; // getMonth() is zero-based
  var dd = this.getDate();

  return [this.getFullYear(),
          (mm>9 ? '' : '0') + mm,
          (dd>9 ? '' : '0') + dd
        ].join('-');
};

function validateNumber(event) {
    var key = window.event ? event.keyCode : event.which;
    if (event.keyCode === 8 || event.keyCode === 46) {
        return true;
    } else if ( key < 48 || key > 57 ) {
        event.preventDefault();
        return false;
    } else {
        return true;
    }
};

//function to set Indentifier
function generateRandomString(length) {
  var text = "";
  var possible = "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";

  for (var i = 0; i < length; i++)
    text += possible.charAt(Math.floor(Math.random() * possible.length));

  return text;
}
